import React from "react";
import "./style.css"
import { useSelector } from 'react-redux'

function MessageSelf() {
  const lightTheme =  useSelector((state) => state.themeKey);
  var props2 = { name: "You", message: "dfgjhkljhlsadfhgjgfdsSample" };

  return (
    <div className={`message-self-container ${lightTheme ? '' : 'dark'}`}>
      <p className="messageBox">{props2.message}</p>
      <p className="self-time">12:00am</p>
    </div>
  );
}

export default MessageSelf;
